'use strict';
let DxFeedSubscriptionCommand = require('./DxFeedSubscriptionCommand.js');
class DxFeedTimeSeriesSubscriptionCommand extends DxFeedSubscriptionCommand {
    requests;
    constructor() {
        super();
        this.requests = [];
    }
    static create(socketCommunicator, dXFeedMessageFactory, callback, clientId, requests, commandType) {
        let result;
        result = new DxFeedTimeSeriesSubscriptionCommand();
        result.initBase(socketCommunicator, dXFeedMessageFactory, callback, clientId, commandType);
        result.requests = requests;
        return result;
    }
    createDxFeedSubscribeMessage() {
        return this.dXFeedMessageFactory.createSubscribeForTimeSeriesMessage(this.clientId, this.requests);
    }
    createDxFeedUnsubscribeMessage() {
        return this.dXFeedMessageFactory.createUnsubscribeForTimeSeriesMessage(this.clientId, this.requests);
    }
}
module.exports = DxFeedTimeSeriesSubscriptionCommand
